led \"time_to_fall_asleep\" in the merged dataset."]},{"cell_type":"code","execution_count":12,"id":"5a0ffc36","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:31.334934Z","iopub.status.busy":"2023-09-03T15:18:31.333161Z","iopub.status.idle":"2023-09-03T15:18:31.378011Z","shell.execute_reply":"2023-09-03T15:18:31.375839Z"},"papermill":{"duration":0.083274,"end_time":"2023-09-03T15:18:31.381372","exception":false,"start_time":"2023-09-03T15:18:31.298098","status":"completed"},"tags":[]},"outputs":[],"source":["daily_activity_sleep <- daily_activity_sleep %>% \n","  mutate(time_to_fall_asleep = total_time_in_bed - total_minutes_asleep) "]},{"cell_type":"code","execution_count":13,"id":"e4a12883","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:31.461349Z","iopub.status.busy":"2023-09-03T15:18:31.459462Z","iopub.status.idle":"2023-09-03T15:18:31.511725Z","shell.execute_reply":"2023-09-03T15:18:31.50912Z"},"papermill":{"duration":0.09788,"end_time":"2023-09-03T15:18:31.514819","exception":false,"start_time":"2023-09-03T15:18:31.416939","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6  19</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>id</th><th scope=col>date</th><th scope=col>total_steps</th><th scope=col>total_distance</th><th scope=col>tracker_distance</th><th scope=col>logged_activities_distance</th><th scope=col>very_active_distance</th><th scope=col>moderately_active_distance</th><th scope=col>light_active_distance</th><th scope=col>sedentary_active_distance</th><th scope=col>very_active_minutes</th><th scope=col>fairly_active_minutes</th><th scope=col>lightly_active_minutes</th><th scope=col>sedentary_minutes</th><th scope=col>calories</th><th scope=col>total_sleep_records</th><th scope=col>total_minutes_asleep</th><th scope=col>total_time_in_bed</th><th scope=col>time_to_fall_asleep</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scop