ng":{"height":420,"width":420}},"output_type":"display_data"}],"source":["ggplot(daily_activity_sleep, aes(x = calories, y = time_to_fall_asleep)) + \n","\n","  geom_jitter() + \n","\n","  geom_point() + \n","\n","  geom_smooth(method = \"lm\", se = FALSE) + \n","\n","  labs(title = \"Calories vs times to fall asleep\", x = \"Calories burned\", y = \"Time to fall asleep\") \n","cor(daily_activity_sleep$calories, daily_activity_sleep$time_to_fall_asleep) "]},{"cell_type":"markdown","id":"1b8a3190","metadata":{"papermill":{"duration":0.040638,"end_time":"2023-09-03T15:18:35.568245","exception":false,"start_time":"2023-09-03T15:18:35.527607","status":"completed"},"tags":[]},"source":["From the results, we can observe a weak negative correlation between calories burned and time to fall asleep. This means that people tend to fall asleep faster if they burn more calories. Although this relationship is weak, it encourages further studies to explore the factors that affect sleep quality, including more dependent variables such as diet, sleep schedule, stress, and medical conditions.\n","\n","Next, we will investigate if the number of active minutes in a day has an impact on the time it takes users to fall asleep."]},{"cell_type":"code","execution_count":19,"id":"71869c06","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:35.658807Z","iopub.status.busy":"2023-09-03T15:18:35.656605Z","iopub.status.idle":"2023-09-03T15:18:35.699461Z","shell.execute_reply":"2023-09-03T15:18:35.697146Z"},"papermill":{"duration":0.089672,"end_time":"2023-09-03T15:18:35.702091","exception":false,"start_time":"2023-09-03T15:18:35.612419","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["-0.0752938124529285"],"text/latex":["-0.0752938124529285"],"text/markdown":["-0.0752938124529285"],"text/plain":["[1] -0.07529381"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["0.320898751504028"],"text/latex":["0.320898751504028"],"text/markdown":["0.3208987515