"ggplot(daily_activity_sleep, aes(x = fairly_active_minutes, y = time_to_fall_asleep)) + \n","\n","  geom_jitter() + \n","\n","  geom_point() + \n","\n","  geom_smooth(method = \"lm\", se = FALSE) + \n","\n","  labs(title = \"Fairly active minutes vs times to fall asleep\", x = \"Fairly active minutes\", y = \"Time to fall asleep\") \n"," "]},{"cell_type":"markdown","id":"5b3e400a","metadata":{"papermill":{"duration":0.042218,"end_time":"2023-09-03T15:18:36.256448","exception":false,"start_time":"2023-09-03T15:18:36.21423","status":"completed"},"tags":[]},"source":["We can see that the number of very active minutes, lightly active minutes and sedentary minutes is not correlated with how easy people fall asleep. However, the time to fall asleep has a positive association with the number of fairly active minutes. This means that the more time people spend for fairly active activities, the faster they can fall asleep at night. Because of this, encouraging people to take part in fairly active activities may improve their sleep quality.\n","\n","**3. Trends in daily activity and health habits of users**\n","\n","**a. Classifying people by active levels**\n","\n","We will categorize users based on the number of steps taken a day to see what percentage of smart device users each group account for. Classification is made based on Tudor' research (cited in Bumgardner, 2020):\n","\n","- Sedentary: Less than 5,000 steps/day\n","- Low Active: 5,000 to 7,499 steps/day\n","- Somewhat Active: 7,500 to 9,999 steps/day\n","- Active: 10,000 to 12,500 steps/day\n","- Very Active: More than 12,500 steps/day\n","\n","First, we need to calculate each users' average number of steps per day:"]},{"cell_type":"code","execution_count":21,"id":"a8de9598","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:36.344601Z","iopub.status.busy":"2023-09-03T15:18:36.342684Z","iopub.status.idle":"2023-09-03T15:18:36.370914Z","shell.execute_reply":"2023-09-03T15:18:36.368761Z"},"papermill":{