:false,"start_time":"2023-09-03T15:18:37.932496","status":"completed"},"tags":[]},"source":["The graph indicates that the majority (37.5%) of smart device users are somewhat active, which is a positive trend. However, the percentages of people with sedentary and low active lifestyles are very high, both at nearly 21%, and need to be decreased. In contrast, the proportions of active and very active users are very low, at only 16.67% and 4.17%, respectively, and need to be improved.\n","\n","**b. Distribution of intensity in a day**\n","\n","Before drawing a graph to demonstrate users' average intensity in 24 hours, we need to split the \"activity_hour\" column in \"hour_intensity\" data frame into \"date\" and \"time\""]},{"cell_type":"code","execution_count":28,"id":"a9b76bc2","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:38.06788Z","iopub.status.busy":"2023-09-03T15:18:38.065942Z","iopub.status.idle":"2023-09-03T15:18:38.910288Z","shell.execute_reply":"2023-09-03T15:18:38.908277Z"},"papermill":{"duration":0.893716,"end_time":"2023-09-03T15:18:38.913885","exception":false,"start_time":"2023-09-03T15:18:38.020169","status":"completed"},"tags":[]},"outputs":[],"source":["hourly_intensity <- hourly_intensity %>% \n","\n","  separate(activity_hour, into = c(\"date\", \"time\"), sep= \" \") %>% \n","\n","  mutate(date = ymd(date))  "]},{"cell_type":"markdown","id":"ba2a2f6d","metadata":{"papermill":{"duration":0.04388,"end_time":"2023-09-03T15:18:39.00151","exception":false,"start_time":"2023-09-03T15:18:38.95763","status":"completed"},"tags":[]},"source":["We will now draw a histogram to show hourly intensity distribution"]},{"cell_type":"code","execution_count":29,"id":"fed97069","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:39.093574Z","iopub.status.busy":"2023-09-03T15:18:39.09171Z","iopub.status.idle":"2023-09-03T15:18:39.448045Z","shell.execute_reply":"2023-09-03T15:18:39.444767Z"},"papermill":{"duration":0.405777,"end_time":"2