 see how the average time users wear the tracker change over time."]},{"cell_type":"code","execution_count":41,"id":"dcc54283","metadata":{"execution":{"iopub.execute_input":"2023-09-03T15:18:42.471085Z","iopub.status.busy":"2023-09-03T15:18:42.469162Z","iopub.status.idle":"2023-09-03T15:18:42.781117Z","shell.execute_reply":"2023-09-03T15:18:42.779007Z"},"papermill":{"duration":0.367485,"end_time":"2023-09-03T15:18:42.784827","exception":false,"start_time":"2023-09-03T15:18:42.417342","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AUxd8H8O9su5oKAULvCRAIXZAqRSkWVFCxomLnr9gLj7037L1hQ+yK0qQI\nShGlQ4BACL0YSM/1Lc+LxRhDbnNJ7i53l9/nFWwmM3Obnd3fzU5hmqaBEEIIIYREP66+K0AI\nIYQQQoKDAjtCCCGEkBhBgR0hhBBCSIygwI4QQgghJEZQYEcIIYQQEiMosCOEEEIIiREU2BFC\nCCGExAgK7AghhBBCYkTDCuw01dHZKjHGOF5aV+ar7+o0dOvv78kYG7viSAMsPVrQWSKEkOjS\nsAK7/K337Xb5AGiq757v9tV3dUj4aKpj1apVa9cdrO+KRDQ6S4QQEu2E+q5AWC2/6wcAzce1\nPzI/d8PDH+HKp+q7Rg1a20mPz0ovaJGeFIayZNeuwYMHx7d+sHj/Y+EvPVrQWSKEkGjHGs5e\nsapc0Nre5IhX++ngukmt+7g17rci5+B4qb7rRcLB59go2XtXDFnIqegsEUJItGtAr2Lz/rrj\nsEeJazV9fItej3RO0jTl/jm54ShY8+T51HAUFEWqPyeqwy2HqTKn0BSny6vUV+khF6QLMsbP\nEiGERKcGFNgtuusXAL0fvQHApCf6Adj8xDvlP50/oR1jrO/Tmyv91uGlFzHGktMeLT+yf+Xs\nKROGt2iSZLImdure7+ZH385x/icE2fnOIMbYtD1FZfvnXzKkq12yfprnBKApxbNfvGtk/66N\nEmyCZElp1XnsZbcu2ll8Sk2VBW/cPzSjXZzJ3KRVlyn3vu9S0c0mxaVeVzFRtdWo5Pm0ZMbY\n5X/llR8pzr2PMcYYm55dWH7wxOZrGGMJre8NvKBAPleV52TTo30qDszf/fFQxti1uwvXfToj\no2Wi3SIKJlu7HkP+753FtTtF5eZ0aSzZewMoOfA4Y6xR2kcAqi49O+/9ey9oYk+wmgR7UpMh\n59/45wk3oMx/7a6BXVrbTWJ84zZjpzyw21X5VNf0z/EPdcVnT587tEdKol2yJbTLOP3mh987\n4jkZLQXrmvR3QUbPWSKEEBIwrWFQPIcaiTzjTBtKvZqmecu2mDjGGLek0K0nKNh5HwBbs2sr\n/eKbvVIAXDj/gP7fNS9dyTPGGGvatuug0zIb2wQAthYjlv7tLP+VHW+fDmDqhkU94yVL086j\nxp3zY75LlUuu698EACckZvYdOOz0fm2TTAB4KXXucWfFEt+4MgMA48ydew1Mb5UMoMXwm1uZ\nBHuzqeVpAqlGJTveHQSg/cSl5Uc2PNxLvwa63/ln+cHfp3QG0PfpzQEWFODnqvKcbHykN4Ax\nyw/raXbNGgJg5AtTGGO21I4jzzlvcO+2eg3Pfm